import { render } from '@testing-library/react'
import React, { useState } from 'react'
import DisplayDog from './DisplayDog';

export const Dogs = (dogProps) => {
    let dogs = [];
    const [count, setCount] = useState(0);
    const [dogList, setDogs] = useState([])
    
    function showMoreDogs () {
        console.log ("IN SHOW MORE DOGS")
        dogs = [];
        for (var i = 0 ; i<6 ; i++){
            dogs.push(<DisplayDog addToFav = {dogProps.addToFav}/>)
        };
        setDogs(dogs);
    }


    return(
        <div className="dogs">
            {/* {showMoreDogs()} */}
            <h1>Dogs</h1>
            {dogs}
            <div className="moreButton">
                <button type="button" onClick={() => setCount(count + 1)} className="btn btn-fav">Next Page</button>
            </div>
        </div>  
    )
}
